  false,\n\t\"url\": null,\n\t\"notes\": \"Bathymetry of Lake Superior has been compiled
  as a component of a NOAA project to rescue Great Lakes lake floor geological and
  geophysical data and make it more accessible to the public. This project is a cooperative
  effort between investigators at the NOAA National Geophysical Data Center's Marine
  Geology and Geophysics Division (NGDC/MGG), the NOAA Great Lakes Environmental Research
  Laboratory (GLERL) and the Canadian Hydrographic Service(CHS). Bathymetric data
  have been collected from the Great Lakes in support of nautical charting for at
  least 150 years by the US Army Corp. of Engineers (before 1970), the NOAA National
  Ocean Service (NOS)(after 1970), and the Canadian Hydrographic Service. No time
  frame has been set for completing bathymetric contours of Lake Superior, though
  a 3 arc-second (~90 meter cell size) grid is available.\",\n\t\"license_title\":
